import { QueryParams } from './../resolvers';
import { Context } from './../index';
import { Annotation } from '../entities/Annotation';
import { Document } from '../entities/Document';
import { User } from '../entities/User';
import { throwError } from '../../../../shared/errors';

const user = async (p, args, context) => {
  const { id }: { id: string } = args;
  const user = await User.buildFromId(id, 'Query.user', context);
  return user.resolveAsEntity();
};

const annotation = async (p, args, context) => {
  const { id }: { id: string } = args;
  const annot = await Annotation.buildFromId(id, context?.user?.id, 'Query.annotation', context);
  if (!annot) {
    return null;
  }
  return annot.resolveAsEntity(true);
};

const annotations = async (p, args, context) => {
  const { documentId }: { documentId: string } = args;
  const document = await Document.buildFromId(
    documentId,
    context?.user?.id,
    'Query.annotations',
    context
  );
  if (!document) {
    throwError(
      'Query.annotations',
      `[Document] Entity not found. Query.annotations.Document.buildFromId(${documentId})`
    );
  }
  return (await document.getCalculated('annotations')).map((a) => a.resolveAsEntity(true));
};

const document = async (p, args, context) => {
  const { id }: { id: string } = args;
  const document = await Document.buildFromId(id, context?.user?.id, 'Query.document', context);
  if (!document) {
    return null;
  }
  return await document.resolveAsEntity(true);
};

const session = async (_, __, context: Context) => {
  const { user, token } = context;
  if (!user) return null;
  return {
    ...user,
    token
  };
};

const connectedDocUsers = (p, args, context: Context) => {
  const { documentId } = args;
  const { connectedUsers } = context;
  return connectedUsers.getConnectedUsersForDocument(documentId);
};

const isScrollSyncAvailable = (_, args, context: Context) => {
  const { userId, documentId } = args;
  const { connectedUsers } = context;
  if (!connectedUsers) return false;
  return connectedUsers.isUserConnected(userId) && connectedUsers.hasDocumentForScroll(documentId);
};

const scrollSyncPosition = (_, args, context: Context) => {
  const { documentId } = args;
  const { connectedUsers } = context;
  return connectedUsers.getScrollPositionForDocument(documentId);
};

const documents = async (_, args, context: Context) => {
  const { userId, limit, before, orderBy = 'updatedAt', orderDirection } = args;

  const property = orderBy === 'updatedAt' ? 'updatedBefore' : 'createdBefore';

  const filters: QueryParams = {
    orderBy: orderBy || 'updatedAt',
    orderDirection: orderDirection || 'DESC'
  };

  if (before !== undefined) {
    filters[property] = before;
  }

  if (limit) {
    filters.limit = limit;
  }

  const docs = await context.resolvers.Query.documents({
    userId,
    filters
  });

  const results = await Promise.all(
    docs.map(async (entity) => {
      const d = new Document(entity, userId, 'Query.documents', context);
      return d.resolveAsEntity();
    })
  );

  return results;
};

const mentions = async (_, args, context: Context) => {
  const { annotationId } = args;
  const { user } = context;
  const annotation = await Annotation.buildFromId(annotationId, user.id, 'Query.mentions', context);
  if (!annotation) {
    throwError('Query.mentions', `[Annotation] Entity not found. Query.mentions.Annotation.buildFromId(${annotationId})`);
  }
  const mentions = await annotation.getCalculated('mentions');
  return Promise.all(mentions.map(m => m.resolveAsEntity()));

}
export default {
  user,
  annotation,
  annotations,
  document,
  session,
  isScrollSyncAvailable,
  scrollSyncPosition,
  connectedDocUsers,
  documents,
  mentions,
};
